const axios = require("axios");

export function get(id = "14") {
  // console.log(`https://simple-blog-api.crew.red/posts${"/" + id}`);
  return axios
    .get(`https://simple-blog-api.crew.red/posts`)
    .then(function(response) {
      console.log(444);
      return {
        posts: response.data
      };
    })
    .catch(function(error) {
      console.log(error);
    });
}
